import React from "react";
import styles from './styles.module.scss';

const Cart = ({
    cartItems
}) => {
    return (
        <div className={styles.cart}>
            <div className={styles.cart__inner}>
                {cartItems.map(item => 
                    <div className={styles.cart__item}>
                        <img src={item.imageUrl} />
                    </div>
                )}
            </div>
        </div>
    )
}

export default Cart
